            content: "Mientras Acates se dirige a las naves para buscar a Ascanio y los regalos, Venus, en el Olimpo, trama un plan para garantizar la seguridad de Eneas. Temerosa de la influencia de Juno sobre los 'bilingües' tirios, decide intervenir de forma drástica. Se dirige a su hijo Cupido, el dios del amor, y le pide que tome la forma del joven Ascanio. Mientras el verdadero Ascanio es transportado por Venus a un idílico bosque en Citera para ser adormecido, Cupido, con la apariencia del niño, irá al banquete. Allí, cuando la reina Dido lo abrace y lo siente en su regazo, él deberá 'inspirarle un fuego oculto y engañarla con veneno', borrando el recuerdo de su difunto esposo Siqueo y encendiendo en ella una pasión arrolladora por Eneas."
